import React, {useState} from 'react';
import {Tabs, Tab, Grid, Container} from '@mui/material';
import ActiveCallsTable from '../activeCallsView/ActiveCallsTable';

function OverView(props) {
    const [tab, setTab] = useState(0);

    return (
        <Grid container>
            <Grid item xs={12}>
                <Tabs value={tab} onChange={(e, val) => setTab(val)} centered variant="fullWidth">
                    <Tab label="שיחות פעילות" />
                    <Tab label="סטטיסטיקות" />
                    <Tab label="הקלטות" />
                </Tabs>
            </Grid>
            <Grid item xs={12}>
                <Container>
                    <br/>
                    {
                        tab === 0 ? (
                            <ActiveCallsTable systemId={props.systemId}/>
                        ) : (
                            null
                        )
                    }        
                </Container>

            </Grid>
        </Grid>
    );
}

export default OverView;
